// Maintain message history
var messageHistory = new List<IMessage>
{
    // Add a system message to define the assistant's behavior
    new TextMessage(Role.System, "You are an SQL Server assistant that helps the user to write and return SQL Script only as output.")
};

string? UserQuery;
while (true)
{
    Console.WriteLine("Enter your prompt Below:");
    UserQuery = Console.ReadLine();

    if ("quit,exit,close".Contains(UserQuery.ToLower()))
        break;


    // Send the message history with the user's prompt
    var reply = await lmAgent.SendAsync(UserQuery,messageHistory);

    if (reply is TextMessage textMessage)
    {
        // Add the assistant's reply to the message history
        messageHistory.Add(new TextMessage(Role.User, textMessage.Content));

        // Extract and print the SQL query
        Console.WriteLine(CheckAndReturnSQL(textMessage.Content));
        // Add the assistant's reply to the message history
        messageHistory.Add(new TextMessage(Role.Assistant, textMessage.Content));
    }
}

string CheckAndReturnSQL(string plainText)
{
    // Regex pattern to match
    string pattern = @"```(?:sql)?\s*(.*?)```"; // "sql" label is optional

    // Singleline mode to match across lines
    Regex regex = new Regex(pattern, RegexOptions.Singleline);

    // Perform the match
    Match match = regex.Match(plainText);

    if (match.Success)
    {
        // Extract the SQL query
        return match.Groups[1].Value.Trim();
    }
    else
    {
        return string.Empty;
    }
}
